//  SPDX-License-Identifier : MIT
pragma solidity ^0.8.11;

contract solidity{

         struct Candidate{
    uint id ;
    string name;
    uint votes;  
         }

         uint public candidatesCount;

         mapping(uint => Candidate) public candidates;
         mapping (address => bool ) public votedOrNot;
         event electionUpdated(    
             uint id
              , string name
              , uint votes  );
    constructor(){
        addCandidate(" Donald Truimph  ");
        addCandidate( " Barakh Obama ");
    }
    // add Candidate
    function addCandidate(string memory name) private {
        candidatesCount++;
        candidates[candidatesCount]= Candidate( candidatesCount, name , 0 );           
    }

    function Vote(uint _id) public 
    {
        // the person must not vote the candidate again .
        require( !votedOrNot[msg.sender] , "you have voted for the participant"   );

        // the candidate id should be valid .
         require(candidates[_id].id != 0 , "the id doesn't exist");
         candidates[_id].votes ++;
         votedOrNot[msg.sender] = true;
         emit electionUpdated(_id , candidates[_id].name , candidates[_id].votes );
    }



}
